import { useEffect } from "react";
import axios from "axios";


export const Categories=()=>{
    useEffect(()=>{
        (async ()=>{
            try{
                const {data}=await axios.get("https://travel-app-backend-five.vercel.app/api/category")
                console.log(data);
            }catch(err){
                console.log(err);
            }
        })()
    },[])
    return(
        <>
            <section className="d-flex align-center">

            </section>
        </>
    )
}
